import ExpenseTracker from './components/UserData';


function App() {

  const expense = [
    {
      title: "Walnut brownie",
      amount: 250,
      date: new Date(2022, 1, 5),
    },
    {
      title: "Chocolate brownie",
      amount: 150,
      date: new Date(2022, 2, 10),
    },
    {
      title: "Peanut brownie",
      amount: 450,
      date: new Date(2022, 3, 15),
    },
    {
      title: "Rum brownie",
      amount: 1150,
      date: new Date(2022, 4, 20),
    },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <input type='search'></input>

      <ExpenseTracker
        title={expense[0].title}
        date={expense[0].date}
        amount={expense[0].amount}></ExpenseTracker>
      <ExpenseTracker
        title={expense[1].title}
        date={expense[1].date}
        amount={expense[1].amount}></ExpenseTracker>
      <ExpenseTracker
        title={expense[2].title}
        date={expense[2].date}
        amount={expense[2].amount}></ExpenseTracker>
      <ExpenseTracker
        title={expense[3].title}
        date={expense[3].date}
        amount={expense[3].amount}></ExpenseTracker>
    </div>
  );
}

export default App;
